import { StyleSheet } from "react-native";

export default StyleSheet.create({
    h1: {
        fontSize: 30,
        fontWeight: "bold",
    },
    titelName:{
        fontSize: 30,
    },
    displayName: {
        fontSize: 17,
        fontWeight: "bold",
    },
});
